import React from 'react';
import Contact from '../components/Contact';
import Navigation from '../components/Navigation';

const Home = () => {
  return (
    <div className="home">
      <Navigation />
      <div className="homeContent">
        <Contact />
      </div>
    </div>
  );
};

export default Home;
